  MainContainer,
  HeadingContainer,
  BottomContainer,
  HeadingText,
} from "../../styles/views/splitter";

export const SplitterView = () => {
  return (
    <MainContainer>
      <HeadingContainer>
        <HeadingText>Sltter</HeadingText>
      </HeadingContainer>
      <BottomContainer></BottomContainer>
    </MainContainer>
  );
};
